import React from 'react'
import Item from './Item';

const Catalog = () => {
  const products = [
    {
      title: 'Blusa de Verano',
      price: 40000,
      description: 'Blusa de manga larga con corte holgado, en tela ligera de color claro con rayas verticales en tono contrastante. Diseño casual y versátil.',
      images: ['blusa1a']
    },
    {
      title: 'Camiseta Blanca',
      price: 25000,
      description: 'Camiseta de manga corta en color blanco, con cuello redondo y diseño liso. Estilo básico y versátil.',
      images: ['camisa1a', 'camisa1b', 'camisa1c']
    },
    {
      title: 'Camiseta Negra',
      price: 25000,
      description: 'Camiseta negra de manga corta con cuello redondo y diseño minimalista. Presenta texto blanco en el centro con espaciado amplio entre letras. Estilo moderno y casual.',
      images: ['camisa2a', 'camisa2b', 'camisa2c'],
    },
    {
      title: 'Camiseta Estilo Urbano',
      price: 30000,
      description: 'Camiseta beige de manga corta con cuello redondo. Presenta un diseño gráfico en azul con un gato de la suerte y texto en japonés, acompañado de la palabra "ORIGINAL" en mayúsculas. Estilo urbano y moderno.',
      images: ['camisa3a'],
    },
    {
      title: 'Camiseta Blanca Urbana',
      price: 25000,
      description: 'Camiseta blanca de manga corta y cuello redondo con un diseño urbano. Presenta un texto en negro con estilo graffiti que dice "Fucking Awesome". Combina con un look casual y relajado.',
      images: ['camisa4a'],
    },
    {
      title: 'Camiseta Negra 705',
      price: 30000,
      description: 'Camiseta negra de estilo minimalista con un pequeño estampado circular en el pecho que contiene el número "705" en el centro. Corte clásico y diseño versátil.',
      images: ['camisa5a'],
    },
    {
      title: 'Gorra Trucker Blanca',
      price: 15000,
      description: 'Gorra blanca tipo trucker con panel frontal sólido y malla en la parte trasera para mayor ventilación. Diseño simple y versátil, ideal para personalización o uso casual.',
      images: ['gorra1a'],
    },
    {
      title: 'Gorra Baseball Blanca',
      price: 18500,
      description: 'Gorra blanca estilo béisbol con seis paneles y visera curva. Diseño clásico y minimalista, ideal para combinar con cualquier atuendo.',
      images: ['gorra2a', 'gorra2b'],
    },
    {
      title: 'Jeans Denim Clásico',
      price: 95000,
      description: 'Jeans de mezclilla en tono azul oscuro con corte recto y diseño clásico de cinco bolsillos. Un básico versátil para cualquier ocasión.',
      images: ['jeans1a'],
    },
    {
      title: 'Vestido Esmeralda',
      price: 120000,
      description: 'Vestido largo en color verde con escote en V y mangas tipo capa con volantes. Diseño elegante y fluido ideal para ocasiones especiales.',
      images: ['vestido1a', 'vestido1b'],
    },
    {
      title: 'Zapatillas Runner Plus',
      price: 160000,
      description: 'Zapatilla deportiva en color rojo con diseño de malla transpirable y suela flexible. Ideal para running y actividades deportivas.',
      images: ['zapatillas1a'],
    },
  ]

  return (
    <article className='grid lg:grid-cols-3 md:grid-cols-2 grid-cols-1 gap-8 my-32 mx-20'>
      { /*(Article) Justification:
      https://developer.mozilla.org/es/docs/Web/HTML/Element/article */ }
      {products.map((product, index) => (
        <Item
          key={index}
          title={product.title}
          price={product.price}
          description={product.description}
          images={product.images}
        />
      ))}
    </article>
  )
}

export default Catalog

